import React from 'react';
import '../Styles/realizar-doacoes.css';
import { Link } from 'react-router-dom';
import NavBar from '../components/NavBar';
import { Stack, Button, Typography, Grid } from '@mui/material';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import CssBaseline from '@mui/material/CssBaseline';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import TextField from '@mui/material/TextField';
import { useNavigate } from 'react-router-dom';
const mainTheme = createTheme({ palette: { mode: 'dark', }, });

function RealizarDoacoes() {
  const navigate = useNavigate();
  return (
    <ThemeProvider theme={mainTheme}>
      <CssBaseline />
      <NavBar isLoggedIn={true} />
      <Container component="main">
        <Box sx={{ margin: 2 }}>
          <Typography variant="h2" align='center'>ONGs que ajudam os animais</Typography>
          <Divider orientation="horizontal" flexItem />
        </Box>

        <Stack spacing={2} direction='column' divider={<Divider orientation="horizontal" flexItem />}>
          <Button variant="outlined" href="https://www.instagram.com/osindefesos/">ONG indefesos RJ</Button>
          <Button variant="outlined" href="https://www.instagram.com/ongviralatafeliz/">ONG Vira Lata Feliz</Button>
          <Button variant="outlined" href="https://www.instagram.com/ongpatinhasunidas/">ONG Patinhas Unidas</Button>
        </Stack>

      </Container>

    </ThemeProvider >
  );
}

export default RealizarDoacoes;
